Описание:
Литос Легкая кладка.
Анионактивный пластификатор кладочных и штукатурных растворов. Воздухововлекающая добавка. Заменитель извести.
Особо рекомендуется для применения в кладочных и штукатурных растворах, является сильной воздухововлекающей добавкой, обладает функцией смачивателя и пластификатора в растворах при их перемешивании.
Воздушные поры, образованные ЛИТОС-ЛЕГКАЯ КЛАДКА отличаются превосходной стабильностью и существенно снижают усадку и связанное с этим растрескивание в цементных растворах. ЛИТОС-ЛЕГКАЯ КЛАДКА обеспечивает быстрое смачивание и диспергирование строительных растворов, пониженную клейкость к рабочим инструментам, улучшает пластичные свойства смесей.
Основные достоинства:
- улучшает удобоукладываемость и увеличивает время использования растворов от 4 до 8ч (в зависимости от температуры окружающего воздуха);
- снижает усадку кладочного и штукатурного растворов;
- снижает появление высолов на фасадах кирпичных домов;
- поверхность затвердевшего раствора становится более ровной и обладает гидрофобными свойствами;
- повышает адгезию к основанию;
- образует особо микропористую структуру материала, перекрывает движение воды в капиллярах, при этом паропроницаемость стены не снижается;
- увеличивает морозостойкость растворов более чем в 3 раза;
- снижает количество воды для приготовления раствора на 10-20%;
- полностью исключает применение извести;
- одобрено Министерством регионального строительства и Министерством охраны здоровья Украины.
Расход:
100мл ЛИТОС-ЛЕГКАЯ КЛАДКА на 25 кг цемента - для кладочного раствора,
150мл ЛИТОС-ЛЕГКАЯ КЛАДКА на 25 кг цемента – для штукатурного раствора.
Рекомендуется растворение ЛИТОС-ЛЕГКАЯ КЛАДКА в воде:
1л ЛИТОС-ЛЕГКАЯ КЛАДКА на 200 л воды - для кладочного раствора,
1,2 -1,5л ЛИТОС-ЛЕГКАЯ КЛАДКА на 200 л воды – для штукатурного раствора.
Рекомендации по применению:
ЛИТОС-ЛЕГКАЯ КЛАДКА добавить в необходимое для замеса количество воды, перемешать в течении 2 мин, добавить цемент и заполнители, интенсивно перемешать.
При превышении рекомендуемых дозировок возможно снижение прочности затвердевшего раствора.
Внимание: обладает щелочной реакцией. Хранить только в герметичной таре. При работе с материалом необходимо использовать средства защиты (резиновые перчатки и респиратор). При попадании на кожные покровы или в глаза необходимо их промыть большим количеством воды, при необходимости обратиться за медицинской помощью.
Состав: органические анионные поверхностно-активные вещества, не содержит хлоридов. Используются высококачественные компоненты, изготовленные в Германии.
Гарантийный срок хранения: 12 мес со дня изготовления в герметичной таре.
